class Solution:
	def maxWidthRamp(self, A):
		"""
		:type A: List[int]
		:rtype: int
		"""
		n = len(A)
		res = [0] * n
		min_num = A[0]
		for i in range(1, n):
			for j in range(0, i-res[-1]):
				# print(i,j)
				if A[j] <= A[i]:
					res[i] = max(res[i - 1], i - j)
					break



		return res[-1]

	def maxWidthRamp1(self, A):
		A = sorted(enumerate(A),key = lambda x:x[1])
		# print(A)
		res = 0
		small_loc = A[0][0]
		for i,_ in A:
			if i < small_loc:
				small_loc = i
			else:
				res = max(res,i-small_loc)
		return res





